(284, '_cs_options', 'a:20:{s:8:"phone_no";s:18:"+7 (499) 406-04-64";s:7:"address";s:55:"г. Москва, Походный проезд, д. 14";s:9:"mail_info";s:17:"sl@soldisgroup.ru";s:11:"header_logo";s:0:"";s:11:"footer_logo";s:0:"";s:12:"site_favicon";s:0:"";s:14:"site_preloader";s:0:"";s:13:"partner_logos";s:47:"118,117,116,115,114,113,112,111,110,109,108,107";s:15:"hero_area_title";s:137:"Группа компаний SOLDIS – многопрофильная инвестиционно-строительная группа.";s:14:"hero_area_desc";s:32:"Год основания - 1998";s:20:"hero_area_background";s:0:"";s:18:"company_area_title";s:19:"О КОМПАНИИ";s:17:"company_area_desc";s:622:"Подавляющее большинство заказчиков в период сотрудничества с нашей компанией становятся друзьями и партнерами на долгие годы – в этом основная сила нашей компании\r\n\r\nГлавным капиталом компании является безупречная репутация, надежные деловые связи, компетентность и профессионализм.\r\n\r\nУ нас твердые позиции и уверенный взгляд в будущее.";s:23:"feature_area_background";s:0:"";s:18:"feature_area_title";s:33:"НАШИ ПРЕИМУЩЕСТВА";s:17:"feature_area_desc";s:579:"Благодаря высокому профессиональному уровню управления строительством, применению современных строительных решений, новейших производственных технологий, а также использованию первоклассного штата сотрудников, возведение объектов выполняется в запланированные сроки при оптимальной стоимости строительства.";s:18:"feature_area_lists";a:6:{i:1;a:1:{s:5:"s_l_d";s:33:"Соблюдение сроков";}i:2;a:1:{s:5:"s_l_d";s:50:"Соблюдение бюджетных рамок";}i:3;a:1:{s:5:"s_l_d";s:73:"Гарантия на все проведенные нами работы";}i:4;a:1:{s:5:"s_l_d";s:82:"Обязательное послегарантийное обслуживание";}i:5;a:1:{s:5:"s_l_d";s:33:"Соблюдение СНиПов";}i:6;a:1:{s:5:"s_l_d";s:172:"Использование современных строительных материалов, инструментов и технологий строительства";}}s:16:"contact_area_img";s:0:"";s:14:"google_map_lat";s:7:"41.3851";s:14:"google_map_lan";s:6:"2.1734";}', 'yes');
